// user action
export const userAction = (payload) => ({
    type: 'USER',
    payload
});

// formatted action
export const formattedAction = (payload) => ({
    type: 'FORMATTED',
    payload
});

// login action

export const loginAction = (payload) => ({
    type: 'LOGIN',
    payload
});
